import {MainPage} from './Components/mainPage/MainPage';
import {C_Icon} from '../'

function App(){
  return(
    <div id="App">
      <div className="leftMenuBar blur">

        <div className="homeIcon">
          <C_Icon icon="home" />
        </div>

        <div className="option">
          <C_Icon onClick={() => this.openClients()} icon="people" />
        </div>

      </div>
      <MainPage />
    </div> 
  )
}

export default App;
